string matrizpaginada::leerdisco(int i, int j) {
    FILE *fp= fopen("archivo.txt","r");
    if (fp==NULL){
        cout<<"fallo"<<endl;
        exit(1);
    }
    char linea[15];
    char *token;
    for (int numerolinea = 0; numerolinea <= j ; ++numerolinea) {
        fgets(linea,15,fp);
    }
    token= strtok(linea," ");
    for (int numerocolunma = 1; numerocolunma <= i ; ++numerocolunma) {
        token= strtok(NULL," ");
    }
    fclose(fp);
    return token;
}
